package api;

public class Mensaje {
	
	private String message;
	
	public Mensaje() {}

	public Mensaje(String message) {
		// TODO Auto-generated constructor stub
		super();
		setMessage(message);
	}

	public String getMessage() {
		return message;
	}

	public void setMessage(String message) {
		this.message = message;
	}



}
